Console.WriteLine(s.PossibleStringCount("", 1658));

public class Solution
{
    public int PossibleStringCount(string word, int k)
    {

        int mod = 1_000_000_007;
        List<int> RunLengths = new List<int>();
        char prev = word[0];
        int count = 1;

        long totalPerms = 1;
        for (int i = 1; i < word.Length; i++)
        {
            if (prev == word[i])
            {
                count++;
            }
            else
            {
                prev = word[i];
                RunLengths.Add(count);
                totalPerms = (totalPerms * count)%mod;
                count = 1;
            }
        }
        RunLengths.Add(count);
        totalPerms = (totalPerms * count)%mod;


        int n = RunLengths.Count;

        Dictionary<(int, int), int> dict = new Dictionary<(int, int), int>();

        int Solve(int i, int j)
        {
            if (dict.ContainsKey((i, j)))
            {
                return dict[(i, j)];
            }
            if (i > n || j >= k)
            {
                return 0;
            }
            if (i == n)
            {
                if (j <= k - 1)
                {
                    return 1;
                }
            }

            int ans = 0;
            for (int m = 0; m < RunLengths[i]; m++)
            {
                ans = (ans + Solve(i + 1, j + m + 1)) % mod;
            }

            dict[(i, j)] = ans;

            return dict[(i, j)];

        }

        int invalid = Solve(0, 0);
        
        return (int)((totalPerms - invalid + mod) % mod);

        
    }
}